original_question:
त्रिभुज $ABC$ समद्विबाहु है, जिसमें $AB=AC$ और ऊँचाई $AM=11$ है। मान लीजिए कि $\overline{AM}$ पर एक बिंदु $D$ है जिसके लिए $AD=10$ और $\angle BDC=3\angle BAC$ है। त्रिभुज $ABC$ का परिमाप ज्ञात करें।

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

